    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from September through
    December of 1963. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover during this period. Wildlife- including
    migratory birds, big game animals, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments. Resource management is
    outlined; topics include grazing. The public relations section of the report describes
    Refuge visitors. N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
